export default function Form() {
	return (
	<form className="w-42 flex flex-col justify-evenly items-center">
		<input className="bg-blue-100 w-full" type="text" name="name" placeholder="Your Name"/>
		<input className="bg-blue-100 w-full" type="email" name="email" placeholder="Your E-Mail"/>
		<textarea className="bg-blue-100 w-full" name="message" placeholder="Your Message"></textarea>
		<button type="submit">Send!</button>
	</form>
	);
}
